import { Component } from "react";

export class StayFilter extends Component {


    render() {
        return (
            <section>
                <button>Cancellation flexibillty</button>
                <button>Type of place</button>
                {/* house */}
                {/* appartment */}
                {/* loft */}
                {/* villa */}
                <button>Price</button>
                <button>Amenities</button>
                <button>More filters</button>
            </section>
        )
    }
}
